import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useAuth } from "../Hooks/UseAuth";
import { useNavigate } from "react-router-dom";
import { signOut } from 'firebase/auth';
import { auth } from "../firebase";
import Bisonte from '../imgs/ElTims.png';
import './NavigationLayout.css';
//import Chats from '.../pages/Chats';

function Navigation() {
  const { logout } = useAuth();
  const navigate = useNavigate();

  const endSession = (event) => {
    logout();
  }

  return (
    <Navbar className="navbar-home">
      <Container>
      <Navbar.Brand href="#home">
            <img
              src={Bisonte}
              width="30"
              height="30"
              className="d-inline-block align-top"
              alt="React Bootstrap logo"
            />
              El Tims
          </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="containerFluid me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            {/* <Nav.Item> 
              <Nav.Link onClick={() => { navigate("/Test", { replace: true }); }} className='text-light'>
                Canales
              </Nav.Link>
            </Nav.Item>*/}
            <Nav.Item>
              <Nav.Link onClick={() => { navigate("/Principal", { replace: true }); }} className='text-light'>
                Pagina Principal
              </Nav.Link>
            </Nav.Item>
            <Nav.Link onClick={() => { navigate("/Chats", { replace: true }); }} className='text-light'>
                Mensajes
              </Nav.Link>
            <Nav.Item>
            </Nav.Item>

          </Nav>
          <Nav>
            <NavDropdown title={<span className="text-light">Mi perfil</span>} id="navbarScrollingDropdown" >
              <NavDropdown.Item href="/MiPerfil">Mis datos</NavDropdown.Item>

              <NavDropdown.Divider />
              <NavDropdown.Item onClick={()=>signOut(auth)}>
              Cerrar Sesi√≥n
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Navigation;
